import React from 'react';
import { Card, CardGroup } from 'react-bootstrap';
import '../../App.css';

import "./Services.css";

export default function Services() {

    return (
        <section id="Places">
        <div className="container my-3 py-5 text-center">
        <div className="row mb-5">
            <div className="col">
              <h1>Vacation Packages</h1>
              <p className="mt-3">
      The mesmerizing wrought-iron spire of the Eiffel Tower piercing the skyline, the Arc de Triomphe guarding the most glamorous avenue,
       the Champs Elysees, the regal Notre Dame cathedral, 
      lamp lit bridges spanning the Seine and art nouveau cafes spilling onto wicker-chair-lined terraces. </p>
            </div>

        </div>

        </div>
        </section>
 );
}
